const base = $('Map AI fields').item.json;
const resp = $input.first().json;

let arr = resp;
// HTTP Request node might return already-parsed JSON (array) or a string body.
if (typeof arr === 'string') {
  try { arr = JSON.parse(arr); } catch (e) { arr = []; }
}

if (Array.isArray(arr) && arr.length > 0) {
  const g = arr[0];
  const lat = g.lat !== undefined ? parseFloat(g.lat) : null;
  const lon = g.lon !== undefined ? parseFloat(g.lon) : null;
  const cc = g.address && g.address.country_code ? String(g.address.country_code).toUpperCase() : null;
  return [{ json: { ...base, lat, lon, geo_country: cc, geo_status: 'OK' } }];
}

const hasAddr = base.address && String(base.address).trim().length > 0;
return [{ json: { ...base, lat: null, lon: null, geo_country: null, geo_status: hasAddr ? 'NOT_FOUND' : 'NO_ADDRESS' } }];
